import React from "react";
import { Redirect } from "react-router-dom";
import {
  Link,
  withRouter,
  useHistory,
} from "react-router-dom";


const Controls = withRouter(() => {
    const history = useHistory();
    return (
      <>
        <div>
          <Link to={`/page-0`}>Link To Screen-0</Link>
        </div>
        <div>
          <Link to={`/screen-two`}>Link to Screen-two</Link>
        </div>
        <div>
          <button onClick={() => history.push(`/screen-one`)}>History push to Screen-one</button>
        </div>
        <Redirect from="/" to="/page-1" noThrow />
      </>
    );
  });

  export default Controls;
